import Vue from 'vue'
import App from './App.vue'
import Api from './api/index.js'
Vue.prototype.$api = Api

Vue.config.productionTip = false

new Vue({
  render: h => h(App),
  beforeCreate() {
    Vue.$bus = this
  }
}).$mount('#app')
